def test_parse_input():
    assert solution.parse_input(t1)==([[1, 2, 1], [3, 1, 3], [2, 2, 1], [1, 1, 2]], {2: ['D', 'C', 'M'], 1: ['N', 'Z'], 3: ['P']})
def test_part_1():
    
    inp=solution.parse_input(t1)
    inp2=solution.parse_input(t2)
    assert solution.part_1(inp[0],inp[1])=="CMZ"
    assert solution.part_1(inp2[0],inp2[1])=="ZBDRNPMVH"

